import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

import img1 from './interview1.jpg';
import img2 from './interview2.jpg';
import img3 from './interview3.jpg';
import img4 from './interview4.jpg';
import img5 from './interview5.jpg';
import img6 from './interview6.jpg';
import img7 from './interview7.jpg';
import img8 from './interview8.jpg';
import img9 from './interview9.jpg';
import img10 from './interview10.jpg';

const images = [img1, img2, img3, img4, img5, img6, img7, img8, img9, img10];

const Signup = () => {
  const [form, setForm] = useState({ name: '', email: '', password: '', skills: '' });
  const [error, setError] = useState(null);
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
    }, 1000); // change image every 1 second

    return () => clearInterval(interval); // cleanup on unmount
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch('http://localhost:5000/api/auth/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(form)
      });
      const data = await res.json();
      if (!res.ok) throw new Error(data.msg);
      localStorage.setItem('token', data.token);
      navigate('/');
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <div style={{ minHeight: '100vh', backgroundColor: '#000', color: '#fff' }}>
      <header style={{ textAlign: 'center', padding: '1rem', fontSize: '24px' }}>
        "Sharpen your skills with prep4Sde! ðŸš€"
      </header>

      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        {/* Image Slideshow */}
        <div style={{ flex: 1, display: 'flex', justifyContent: 'center' }}>
          <img
            src={images[currentImageIndex]}
            alt="Slideshow"
            style={{ maxHeight: '500px', borderRadius: '10px', transition: 'opacity 0.5s' }}
          />
        </div>

        {/* Signup Form */}
        <div style={{ flex: 1, padding: '2rem', maxWidth: '400px' }}>
          <h1 style={{ fontSize: '30px', fontWeight: 'bold', textAlign: 'center' }}>prep4Sde</h1>
          <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            <input type="text" name="name" placeholder="Name" onChange={handleChange} required />
            <input type="email" name="email" placeholder="Email" onChange={handleChange} required />
            <input type="password" name="password" placeholder="Password" onChange={handleChange} required />
            <input type="text" name="skills" placeholder="Skills (comma separated)" onChange={handleChange} required />
            {error && <p style={{ color: 'red', fontSize: '13px' }}>{error}</p>}
            <button type="submit">Sign Up</button>
          </form>
          <p style={{ marginTop: '10px' }}>
            Already have an account? <a href="/login" style={{ color: 'lightblue' }}>Login</a>
          </p>
        </div>
      </div>

      <footer style={{ textAlign: 'center', padding: '1rem', fontSize: '14px', borderTop: '1px solid gray' }}>
        <a href="#" style={{ margin: '0 10px', color: 'gray' }}>Privacy Policy</a>
        <a href="#" style={{ margin: '0 10px', color: 'gray' }}>Terms</a>
        <a href="#" style={{ margin: '0 10px', color: 'gray' }}>About</a>
        <a href="#" style={{ margin: '0 10px', color: 'gray' }}>Help</a>
        <a href="#" style={{ margin: '0 10px', color: 'gray' }}>Contact</a>
        <p style={{ marginTop: '5px', color: 'gray' }}>Â© {new Date().getFullYear()} prep4Sde</p>
      </footer>
    </div>
  );
};

export default Signup;
